import react from 'react'
import Emojidata from './Emojidata'
import Emgcard from './Emgcard'
import './Body.css'
const Emgcomp=(val)=>{
    return(
    <Emgcard
    Emoji={val}
    />
    )
}
const Body=()=>{
return(
    <>
    <div id="Body">
<div id="innerBody">
{Emojidata.map(Emgcomp)}
</div>
    </div>
    </>
)
}
export default Body
